import React from 'react';
// form 가져오기
const search = document.getElementById("search");


const SearchUp = (e) => {
  e.preventDefault();
  const formData = new FormData();

  fetch("API 주소", {
    method: "GET",
    headers: {
      "Content-Type": "multipart/form-data",
    },
    body: new FormData(search),
  })
    .then((response) => {
      if (response.ok === true) {
        return response.json();
      }
      throw new Error("에러 발생!");
    })
    .catch((error) => {
      alert(error);
    })
    .then((data) => {
      console.log(data);
    });

      return(
          <div id="search">
          <form name="sform" onSubmit={SearchUp} method="get" id="search">
              <select name="option" id="option">
                  <option value="1" class="opt">통합검색</option>
                  <option value="2" class="opt">민법</option>
                  <option value="3" class="opt">판례</option>
              </select>
              <input id="query" name="query" type="text" placeholder="검색어를 입력해 주세요"></input>
              <button id="icon" type="submit"><i class="bi bi-search"></i></button>
          </form>
          </div>
          
          
      )
};





